/* VCD dumping functions */
MOD_mkBeveren_nested & mkBeveren_nested_backing(tSimStateHdl simHdl)
{
  static MOD_mkBeveren_nested *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkBeveren_nested(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
