{
  (mkBeveren_nested_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkBeveren_nested::dump_VCD(tVCDDumpType dt)
{
  (mkBeveren_nested_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkBeveren_nested_backing(sim_hdl));
}
